import '../../styles/Main.css';
import Primise from './Primise';
import MyRentalInfo from './MyRentalInfo';
import axios from 'axios';
import { useState, useEffect } from 'react';

function PrimiseList() {
    const [primeses, setPrimeses] = useState([]);

    useEffect( async () => {
        try {
            const response = await axios.get('http://localhost:3001/premise/notrenated');
            setPrimeses(response.data);
        } catch (error) {
            console.error('Ошибка загрузки данных:', error);
        }
    }, []);

	return (
        <div className="primesController">
            <MyRentalInfo/>
            <div className="primiseList">
            {primeses.map((primese) => (
            <a href="/" className="primise">
                <img src={primese.Image}/>
                <div>{primese.Name}</div>
                <div>2000 BYN</div>
            </a>
            ))}
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>
                <Primise/>  
            </div>
        </div>
  	);
}

export default PrimiseList;
